import React from 'react';
import { Col, Container, Row } from 'reactstrap';
import './../assets/scss/custom/_body.scss'
import MinhasCotacoes from './MinhasCotacoes';
const Body = () => {
    return(
    <>
    <Container>
      <Row>
        <Col>
            <div className="body">
                <div style={{
                    overflowX: 'hidden',
                    overflowY: 'auto'
                }}>
                    <MinhasCotacoes/>
                </div>
            </div>
        </Col>
      </Row>
    </Container>
    </>
    )
}

export default Body;
